import React from "react";
import { NavLink } from "react-router-dom";

const HeadBar = () => {
  return (
    <div className="HeadBar-container">
      <img
        src={process.env.PUBLIC_URL + "/imgs/icon.png"}
        alt="logo-anouanze"
      />
    </div>
  );
};

export default HeadBar;
